import React, { Component } from "react";
import Course from "./Course";
import { Typography } from "@material-ui/core";

export class CourseList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: true,
      response: [],
    };
  }

  componentDidMount() {
    fetch(
      "https://api.nytimes.com/svc/search/v2/articlesearch.json?q=election&api-key=YW7v4jYO5anNGpDXSmDXZhswezl4w6yZ"
    )
      .then((res) => res.json())
      .then((data) => {
        this.setState({ isLoaded: false, response: data.response.docs });
        console.log(data);
      });
  }

  render() {
    return (
      <div>
        {this.state.isLoaded} ? <div>loading...</div> : <div>data...</div>
      </div>
    );
  }
}

export default CourseList;
